    false,nt"url": null,nt"notes": "This plan outlines the goals, objectives,
    rules, costs, potential conflicts, and historical perspective of hunting at the
    Wallkill River National Wildlife Refuge. It has been determined that a public migratory
    bird, deer, turkey, and bear hunting program, conducted in accordance with State
    regulations and refuge specific regulations, will not interfere with the purposes
    for which the refuge was established. The primary changes incorporated in this document
    from the station's Hunt Management Plans of 1993 and 1997 include the addition of
    black bear as a species to be taken and updates of several miscellaneous facts such
    as acreage, statutory authorities, law enforcement resources, program costs.",nt"license_title":
